import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';

let posts = [
    {id: 'p1', likesCount: 12, text: "Oh, I was not made for heaven. No, I don't want to go to heaven. Hell is much better. Think of all the interesting people you're going to meet down there!"},
    {id: 'p2', likesCount: 3, text: "The reason we're successful, darling? My overall charisma, of course."},
    {id: 'p3', likesCount: 72, text: "I am a romantic, but I do put up a barrier around myself, so it is hard for people to get in and to know the real me."}
];

ReactDOM.render(
  <React.StrictMode>
    <App posts={posts}/>
  </React.StrictMode>,
  document.getElementById('root')
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
